import { useState } from "react";
import "./FilterRadio.scss";

const FilterRadio = (props) => {
  const { value, label, handleChange, checked } = props;

  return (
    <div className="radio">
      <input
        checked={checked}
        type="radio"
        value={value}
        onChange={handleChange}
      ></input>
      {label}
    </div>
  );
};

export default FilterRadio;
